/**
 * Dependencies
 */

import React from 'react';
import { Link } from 'react-router-dom';


/**
 *  Import styles
 */

import  '../styles/navbar.scss'

/**
 * Define component
 */

function NavBar(props) {

  function logout() {
    localStorage.clear()
    window.location = '/'
  }

    return (
      <>
            <div className="nav" >
            <div>

            <Link to="/" style={{textDecoration:"none"}} data-testid="signup-link">
                <button
                    id="navSignUp"
                    variant="contained"
                    color="primary"
                    data-testid="signup-button">
                    signup
                </button>
            </Link>
            <Link to="/" style={{textDecoration:"none"}} data-testid="login-link">
                <button
                    id="navSignUp"
                    variant="contained"
                    color="primary"
                    data-testid="signup-button">
                    signup
                </button>
            </Link>

            </div>
         </div>


      </>
    );
};

/**
 * Export component
 */

export default NavBar;
